import { useEffect, useState } from 'react'
import io from 'socket.io-client'
import TreeChannel from './components/TreeChannel/TreeChannel'

import classes from './Admin.module.css'
import ModalWindows from '../../UI/ModalMindow/ModalWindow'

const socket = io('http://10.147.18.205:3001')

interface IResults {
	categorys: Map<string, Array<IItems>> | null
	otherChats: Array<IItems> | null
}
interface IResyved {
	categorys: string
	otherChats: Array<IItems>
}
interface IItems {
	name: string
	id: number
	type: string
}

const Admin = () => {
	const [AllChats, setAllChats] = useState({})

	useEffect(() => {
		const fetchData = async () => {
			try {
				socket.emit('GetAllChannelFromServer', (json: IResyved) => {
					if (json !== null) {
						const results: IResults = {
							categorys: null,
							otherChats: null,
						}
						results.categorys = new Map<string, Array<IItems>>(
							JSON.parse(json.categorys)
						)
						results.otherChats = new Map<string, (
							JSON.parse(json.categorys)
						)
						setAllChats(results)
					}
				})
			} catch (error) {
				console.log('Error fetching data:', error)
			}
		}

		fetchData()
		return () => {
			socket.off('updatePlaylist')
		}
	}, [])

	return (
		<div className={classes.container}>
			<TreeChannel nodeChats={AllChats} />
			<ModalWindows />
		</div>
	)
}

export default Admin
